body:
Based off of PR #9534 
I have updated the flux typings to improve generics in the different Store classes.

case 2. Improvement to existing type definition.
- documentation or source code reference which provides context for the suggested changes.
  - it has been reviewed by a DefinitelyTyped member.
## Breaking Changes
### Container Class

Before:

``` typescript
class Container {
    static create(base: React.ComponentClass<any>, options?: any): React.ComponentClass<any>;
}
```

After:

``` typescript
interface RealOptions {
    pure?: boolean;
    withProps?: boolean;
}
class Container {
    static create<TComponent>(base: React.ComponentClass<TComponent>, options?: RealOptions): React.ComponentClass<TComponent>;
}
```
### Store Class

Before:

``` typescript
class Store {
    constructor(dispatcher: Flux.Dispatcher<any>);
    addListener(callback: Function): { remove: Function };
    getDispatcher(): Flux.Dispatcher<any>;
    __onDispatch(payload: any): void;
}
```

After:

``` typescript
class Store<TPayload> {
    constructor(dispatcher: Flux.Dispatcher<TPayload>);
    addListener(callback: Function): fbEmitter.EventSubscription;
    getDispatcher(): Flux.Dispatcher<TPayload>;
    __onDispatch(payload: TPayload): void;
}
```
### ReduceStore Class

Before:

``` typescript
class ReduceStore<T> extends Store {
    reduce(state: T, action: any): T;
}
```

After:

``` typescript
class ReduceStore<T, TPayload> extends Store<TPayload> {
    reduce(state: T, action: TPayload): T;
}
```
### MapStore Class

Before:

``` typescript
class MapStore<K extends string | number, V, TPayload> extends ReduceStore<immutable.Map<K, V>, TPayload> {
        getAll(keys: any, prev?: any): any;
}
```

After:

``` typescript
class MapStore<K extends string | number, V> extends ReduceStore<any> {
        getAll(keys: immutable.Iterable.Indexed<K>, prev?: immutable.Map<K, V>): immutable.Map<K, V>;
}
```

The actual definition is

``` js
declare module "meteor/meteor" {
  export module Meteor {
    function status(): Meteor.StatusEnum;
  }
}
```

instead of

``` js
declare module "meteor/meteor" {
  export module Meteor {
    interface Status {
      status: Meteor.StatusEnum;
      connected: boolean;
      retryCount: number;
    }
    function status(): Meteor.Status;
  }
}
```

This is to support a common pattern of using `all` to await the completion of multiple promises of potentially different types, without requiring the developer to manually define the types in the callback handler. For example:

``` typescript
function getFoos(): IPromise<Foo> { /* ... */ }
function getBars(): IPromise<Bar> { /* ... */ }

Q.all([
    getFoos(),
    getBars()
]).then(results => {
    let [a, b] = results;
    // here `a` is of type `Foo`, and `b` is of type `Bar`
    a.foo();
    b.bar();
});
```

The additional typings support typed arrays of up to 6 elements, before falling back to old behavior.

Function expressions are now implicitly typed, i.e.

```
browser.on('serviceUp', (service) => {
  \\ `service` is strongly typed as `mdns.Service`
});
```
